import './Hero.scss';
import play from '../../assets/Icons/SVG/play.svg';
import fullscreen from '../../assets/Icons/SVG/fullscreen.svg';
import volume from '../../assets/Icons/SVG/volume.svg';
import scrubber from '../../assets/Icons/SVG/scrubber.svg'


function Hero(props) {
    // console.log(props.videoList)
    return (
        <section className="hero">
            <video className ="hero__img" poster={props.videoList[0]}></video>
            <div className="hero__control-bar">
                <div className ="hero__play">
                    <img className ="hero__play-btn"src={play}></img>
                </div>
                <div className="hero__scrubby"></div>
                <img src={scrubber}></img>
                <div className="hero__control">
                    <img src={fullscreen} className="hero__control-size"></img>
                    <img src={volume} className="hero__control-vol"></img>
                </div>
            </div>
        </section>
    )
}

export default Hero;
